import axios from 'axios';
import { useState } from 'react';

const Accesses = () => {

  const [successAccesses, setSuccessAccesses] = useState(false);
  const [data, setData] = useState([]);
  const [pageNumber, setPageNumber] = useState(1);
  const [pageSize, setPageSize] = useState(50);
  const [sortPropertyName, setSortPropertyName] = useState('');
  const [isSortByDescending, setIsSortByDescending] = useState(true);
  const [addressSearchField, setAddressSearchField] = useState('');
  const [countSearchField, setCountSearchField] = useState(1);

const handleClick = () => {
  setSuccessAccesses(!successAccesses);
}

  const fetchData = async () => {
    const requestBody = {
      pageNumber,
      pageSize,
      sortPropertyName,
      isSortByDescending,
      addressSearchField,
      countSearchField,
    };

    try {
      const url = successAccesses 
        ? process.env.REACT_APP_SUCCESSACCESSES_URL
        : process.env.REACT_APP_ALLACCESSES_URL;

      const response = await axios.post(url, requestBody, {
        headers: {
          'Content-Type': 'application/json',
        },
      });

      setData(response.data.logs);
    } catch (error) {
      console.error('Error fetching data:', error);
      setData([]);
    }
  };

    return (
      <div>
        <h1>{successAccesses ? 'Success Accesses' : 'All Accesses'}</h1>
        <button onClick={handleClick}>Toggle Fetch</button>
        <div>
            <div>
                <input
                type="text"
                placeholder="Address"
                value={addressSearchField}
                onChange={(e) => setAddressSearchField(e.target.value)}
                />
                <input
                type="number"
                placeholder="Count"
                value={countSearchField}
                onChange={(e) => setCountSearchField(Number(e.target.value))}
                />
                <button 
                onClick={fetchData}>Search
                </button>
            </div>
            <div>
                <label>
                Page Size:
                <input
                    type="number"
                    value={pageSize}
                    onChange={(e) => setPageSize(Number(e.target.value))}
                />
                </label>
                <label>
                Page Number:
                <input
                    type="number"
                    value={pageNumber}
                    onChange={(e) => setPageNumber(Number(e.target.value))}
                />
                </label>
            </div>
            <ul>
                {Array.isArray(data) ? (
                data.map((item, index) => (
                    <li key={index}>{JSON.stringify(item)}</li>
                ))
                ) : (
                <li>No data available</li>
                )}
            </ul>
        </div>
      </div>
    );
  };

  export default Accesses;
